import axios from "axios";
import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "./BlogSection.css";
import IMG from "../assets/best-psychiatrists.jpg";

const BlogSection = () => {
  const [blogs, setBlogs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get("http://localhost:5001/blogs")
      .then((response) => {
        if (response.data && Array.isArray(response.data)) {
          // Sort by most likes and most comments
          const sortedBlogs = response.data.sort(
            (a, b) =>
              (b.likes || 0) + (b.comments?.length || 0) -
              ((a.likes || 0) + (a.comments?.length || 0))
          );
          setBlogs(sortedBlogs.slice(0, 2)); // Show top 2 blogs
        }
      })
      .catch((error) => console.error("Error fetching blogs:", error))
      .finally(() => setLoading(false));
  }, []);

  if (loading) {
    return (
      <div className="text-center p-8 text-lg font-semibold">
        Loading blogs...
      </div>
    );
  }

  return (
    <div className="blogsec flex flex-col md:flex-row w-full min-h-screen">
      {/* Left Section - Image (50% width) */}
      <div className="w-full md:w-1/2 h-64 md:h-auto bg-cover bg-center" style={{ backgroundImage: `url(${IMG})` }}></div>

      {/* Right Section - Blog Content (50% width) */}
      <div className="w-full md:w-1/2 px-4 py-6 flex flex-col items-center">
        <h2 className="text-2xl font-bold text-center mb-6">Latest Blogs</h2>

        {blogs.length > 0 ? (
          <div className="flex flex-col gap-6 w-full max-w-xl">
            {blogs.map((blog) => (
              <div
                key={blog._id}
                className="bg-white shadow-md rounded-lg overflow-hidden transition-transform transform hover:scale-105 w-full"
              >
                {/* Blog Image */}
                {blog.image && (
                  <img
                    src={`http://localhost:5001${blog.image}`}
                    alt={blog.title}
                    className="w-full h-40 object-cover"
                  />
                )}

                {/* Blog Content */}
                <div className="p-4 flex flex-col">
                  <p className="text-xs text-gray-500 mb-1">
                    BY <span className="font-semibold">{blog.author}</span> |{" "}
                    {blog.createdAt
                      ? new Date(blog.createdAt).toLocaleDateString("en-US", {
                          year: "numeric",
                          month: "short",
                          day: "numeric",
                        })
                      : "Date not available"}
                  </p>

                  <h1 className="text-lg font-semibold">{blog.title}</h1>
                  <p className="text-gray-700 text-sm mt-2">
                    {blog.sections?.[0]?.paragraph
                      ? blog.sections[0].paragraph.slice(0, 80) + "..."
                      : "No description available."}
                  </p>

                  {/* Likes & Comments Count */}
                  <div className="flex justify-between items-center text-gray-600 text-xs mt-3">
                    <p>❤️ {blog.likes || 0} Likes</p>
                    <p>💬 {blog.comments?.length || 0} Comments</p>
                  </div>

                  <Link
                    to={`/blogs/${blog._id}`}
                    className="text-blue-500 font-semibold mt-3 inline-block"
                  >
                    Read More →
                  </Link>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <p className="text-center text-gray-600">
            No trending blogs available.
          </p>
        )}

        {/* Show More Blogs Button */}
        <div className="text-center mt-6">
          <Link
            to="/bloglist"
            className="bg-blue-500 text-white px-4 py-2 rounded-md shadow-md hover:bg-blue-600"
          >
            Show More Blogs
          </Link>
        </div>
      </div>
    </div>
  );
};

export default BlogSection;
